in_source: |-
  .data:
    limit_for_three NUMBER 999
    limit_for_five NUMBER 1000
    limit_for_fifteen NUMBER 990
  .code:
    PUSH 1
    PUSH 3

    loop_for_three:
      PUSH_VAL limit_for_three
      COMPARE
      POP
      JNE add_three
      POP
      JMP sum_of_mod_3
    add_three:
      PUSH 3
      ADD
      SWAP
      INC
      SWAP
      JMP loop_for_three

    sum_of_mod_3:
      DUP
      PUSH 2
      PUSH 3
      PUSH_VAL limit_for_three
      ADD
      DIV
      MUL
      SWAP
      POP
      PUSH 0
      PUSH 5
      JMP loop_for_five

    loop_for_five:
      PUSH_VAL limit_for_five
      COMPARE
      POP
      JNE add_five
      POP
      JMP sum_of_mod_5

    add_five:
      PUSH 5
      ADD
      SWAP
      INC
      SWAP
      JMP loop_for_five

    sum_of_mod_5:
      PUSH 2
      PUSH 0
      PUSH_VAL limit_for_five
      ADD
      DIV
      MUL
      ADD
      PUSH 0
      PUSH 15
      JMP loop_for_fifteen


    loop_for_fifteen:
      PUSH_VAL limit_for_fifteen
      COMPARE
      POP
      JNE inc_fifteen
      POP
      INC
      INC
      JMP sum_of_mod_15


    inc_fifteen:
      PUSH 15
      ADD
      SWAP
      INC
      SWAP
      JMP loop_for_fifteen
    sum_of_mod_15:
      PUSH 2
      PUSH 0
      PUSH_VAL limit_for_fifteen
      ADD
      DIV
      MUL
      SUB
      PRINT_VAL OUTPUT
      JMP end

    end:
      HLT
